import axios from "axios";
import { useState } from "react";

export default function Weather(){
    var [weatherData,setWeatherData]=useState("")
    axios.get("https://api.openweathermap.org/data/2.5/weather?q=Kadapa&appid=55a0ebcb240d607f077934dec3f7822a")
    .then((res)=>{
        setWeatherData(res.data.weather.id)
    })
    return(
        <>
        <h3>{weatherData[0].id}</h3>
        </>
    );
}
